import React from 'react';
import {Header} from 'semantic-ui-react';
import './login.css';

class Login extends React.Component {
    render() {
        return (
            <div floated = "left" style = {{backgroundColor:"red"}}>
                Login Page      
                <Header as="h2" floated = "left">
                    Login
                </Header>
            </div>
        );
    }
}

export default Login;
